.welcome {
    background-image: url(../img/header-bg.png);
    background-size: cover;
    background-position: center;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
    position: relative;

    .menu-icon-img {
        height: 17px;
        width: 30px;
    }

    .close {
        height: 17px;
        width: 17px;
    }

    h1{
        font-size: 1.5rem;
        font-weight: $fw-n;
        color: $dark-blue;
        line-height: 2;
        text-align: center;

        @include mq {
            font-size: 3vw;
        }

        span {
            @include sans-serif($fs: 5.5rem, $color: $accent);
            display: block;

            @include mq {
                font-size: 10vw;
            }
        }

        &::before,
        &::after{
            content: "";
            display: block;
            width: 60%;
            height: 1px;
            background: $dark-blue;
        }
        &::before{
            margin: 0 auto 2em;
        }
        &::after{
            margin: 2em auto 0;
        }
    }
}

