    background-color: $dark-blue;
    padding: 2.5rem 5vw;
    text-align: center;
    display: flex;
    flex-direction: column;
    justify-content: center;
}

.intro-left img,
.intro-right img {
    object-fit: cover;
    width: 100%;
    height: 100%;
}

sources.scss\\partials\\_about-me.scss:
.about-me {
    @include container;
    margin-top: 5em;
    margin-bottom: 5em;
}

.about-title {
    margin-bottom: .25em;
}

.about-subtitle {
    margin: .5em 0;
}

@supports(display: grid) {
    .about-me {
        display: grid;
        grid-template-columns: [port-start] minmax(6em, 1fr) [title-start] minmax(6em, 1fr) [img-end] 2fr [port-end];
        grid-column-gap: .5em;
        .about-img {
            grid-column: port-start/img-end;
            grid-row: 1 / 2;
            

            @include mq {
                grid-row: 1 / 4;
            }
        }

        .about-title {
            grid-column: title-start / port-end;
            grid-row: 1 / 2;
            align-self: end;
        }

        .about-subtitle,
        .about-text {
            grid-column: port / port;

            @include mq {
                grid-column: img-end / port-end;
            }
        }
  
    }
}

